import React from "react";
import axios from "axios";

import "./Form.css";

const saveTodo = async (event) => {
    event.preventDefault();
    console.log("Clicked~");
    const URL = "/todo";
    axios(URL, {
        method: "POST",
        // mode: "no-cors",
        // headers: {
        //     'Access-Control-Allow-Origin': '*',
        //     'Content-Type': 'application/json',
        // },
        // withCredentials: true,
        // credentials: 'same-origin',
        body:{
            name: "Created from fronted",
        }
    }).then(res => {
        console.log(res);
    });
};

function Form() {
    return (
        <form className="form">
            <label className="label">What to do?</label>
            <input className="input" type="text"></input>
            <button className="button" onClick={saveTodo}>
                Add Todo
            </button>
        </form>
    );
}

export default Form;
